import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./CartPage.css";

const CartPage = () => {
  const navigate = useNavigate();
  const [cart, setCart] = useState([]);
  const [loading, setLoading] = useState(true);

  // Lấy userId từ localStorage
  const user = JSON.parse(localStorage.getItem("user"));
  const userId = user?._id;

  // ===== LẤY GIỎ HÀNG =====
  const fetchCart = async () => {
    try {
      const res = await fetch(`http://localhost:5000/api/cart/${userId}`);
      const data = await res.json();
      setCart(data.items || []);
    } catch (err) {
      console.error("Lỗi lấy giỏ hàng:", err);
    }
    setLoading(false);
  };

  useEffect(() => {
    if (userId) fetchCart();
  }, []);

  // ===== XÓA SẢN PHẨM =====
  const removeItem = async (productId) => {
    await fetch("http://localhost:5000/api/cart/remove", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ userId, productId })
    });

    fetchCart();
  };

  // ===== TĂNG SỐ LƯỢNG =====
  const increaseQuantity = async (productId) => {
    await fetch("http://localhost:5000/api/cart/increase", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ userId, productId })
    });

    fetchCart();
  };

  // ===== GIẢM SỐ LƯỢNG =====
  const decreaseQuantity = async (productId) => {
    await fetch("http://localhost:5000/api/cart/decrease", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ userId, productId })
      
    });
    console.log("User từ localStorage:", user);
    console.log("userId:", userId);

    fetchCart();
  };

  // ===== TÍNH TỔNG =====
  const totalPrice = cart.reduce((sum, item) => sum + item.price * item.quantity, 0);

  if (loading) return <p>Đang tải giỏ hàng...</p>;

  if (!cart.length)
    return (
      <p>
        Giỏ hàng trống. <Link to="/">Quay lại trang chủ</Link>
      </p>
    );

  return (
    <div className="cart-page">
      <h2>Giỏ Hàng</h2>
      <table>
        <thead>
          <tr>
            <th>Sản phẩm</th>
            <th>Giá</th>
            <th>Số lượng</th>
            <th>Thao tác</th>
          </tr>
        </thead>

        <tbody>
          {cart.map((item) => (
            <tr key={item.productId}>
              <td>
                {item.name}
              </td>

              <td>{item.price.toLocaleString()} ₫</td>

              <td>
                <button onClick={() => decreaseQuantity(item.productId)}>-</button>
                {item.quantity}
                <button onClick={() => increaseQuantity(item.productId)}>+</button>
              </td>

              <td>
                <button onClick={() => removeItem(item.productId)}>Xóa</button>
              </td>
            </tr>
          ))}

          <tr>
            <td colSpan={4}>
              <b>Tổng: {totalPrice.toLocaleString()} ₫</b>
            </td>
          </tr>
        </tbody>
      </table>

      <button onClick={() => navigate("/checkout")}>Thanh toán</button>
    </div>
  );
};

export default CartPage;
